using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class ReducerModel : Notifier	{		public ReducerModel()		{					NPS = "";			OD1 = "";			OD2 = "";			H = "";			A = "";		}				private string _NPS;		public string NPS			{				get { return _NPS; }				set				{					_NPS = value;					OnPropertyChanged(nameof(NPS));				}			}				private string _OD1;		public string OD1			{				get { return _OD1; }				set				{					_OD1 = value;					OnPropertyChanged(nameof(OD1));				}			}				private string _OD2;		public string OD2			{				get { return _OD2; }				set				{					_OD2 = value;					OnPropertyChanged(nameof(OD2));				}			}				private string _H;		public string H			{				get { return _H; }				set				{					_H = value;					OnPropertyChanged(nameof(H));				}			}				private string _A;		public string A			{				get { return _A; }				set				{					_A = value;					OnPropertyChanged(nameof(A));				}			}			}}